import React from 'react';

function Food({ fav }) {
  console.log()
  return (
    <h1>I like {fav}</h1>
  );
}

const foorILike = ['kim', 'park', 'choe'];

function App() {
  return (
    <div>
      <h1>Hello!!</h1>
      <Food fav="foodILike" />
    </div>
  );
}

export default App;
